import React from 'react'
import './Button.styles.css'


interface ICommonButton {
	title: string
	path: string
	onClick: (event:  React.MouseEventHandler<HTMLDivElement> | undefined) => void
}
export const CommonButton: React.FC<ICommonButton>=({title, path, onClick}) => {
	return (
		// <div className={"button-container"}>
			<button onClick={() => onClick}>{title}</button>
		// </div>
	)
}
